      setMessages(prev => [...prev, { role: 'model', text: "My neural links are a bit fuzzy right now. Check back in a second!" }]);
    } finally {
      setIsTyping(false);
    }
  };

  return (
    <div className="w-full max-w-2xl mx-auto glass rounded-2xl overflow-hidden flex flex-col h-[500px] border border-white/10 shadow-2xl">
